pragma solidity ^0.4.16;

import "./Metadata.sol";

contract PrimasMetadata is Metadata{

    event LikeLog(
        bytes indexed _dna
    );

    event CommentLog(
        bytes indexed _dna
    );

    event ForwardLog(
        bytes indexed _dna,
        bytes indexed _community
    );

    event ReproduceLog(
        bytes indexed _dna,
        bytes indexed _link
    );

    function like(
    bytes dna,
    bytes signature
    ) public returns(address) {
        address pk = recover(keccak256(dna),signature);
        if(pk != address(0)) {
             LikeLog(dna);
            return pk;
        } else {
            return pk;
        }
    }

    function comment(
    bytes title,
    bytes content_hash,
    bytes license,
    bytes block_hash,
    bytes extras,
    bytes signature
    ) public returns (bytes) {
        bytes memory dna;
        dna = sign_publish(title, content_hash, license, block_hash, extras, signature);
        CommentLog(dna);
        return dna;
    }

    function forward(
    bytes dna,
    bytes community,
    bytes signature
    ) public returns(address){

        address pk = recover(keccak256(dna,community),signature);
        if(pk != address(0)) {
            ForwardLog(dna,community);
            return pk;
        } else {
            return pk;
        }
    }

    function reproduce(
    bytes dna,
    bytes link,
    bytes signature
    ) public returns(address){

        address pk = recover(keccak256(dna,link),signature);
        ReproduceLog(dna, link);
        return pk;
    }

    function recover(
    bytes32 hash,
    bytes sig
    ) internal pure returns(address) {
        bytes32 r;
        bytes32 s;
        uint8 v;

        //Check the signature length
        if (sig.length != 65) {
          return (address(0));
        }

        // Divide the signature in r, s and v variables
        assembly {
          r := mload(add(sig, 32))
          s := mload(add(sig, 64))
          v := byte(0, mload(add(sig, 96)))
        }
        return ecrecover(hash, v, r, s);
    }


}

